import React from 'react'
import CartStyles from './styles/CartStyles'
import useUser from './User'
import Supreme from './styles/Supreme'

const Cart = () => {
    const me = useUser()
    if(!me) return null;
    return (
        <CartStyles open={true}>
            <header>
                <Supreme>{me.name}'s cart</Supreme>
            </header>
        </CartStyles>
    )
}

export default Cart
